import './App.css';
import Login from './Login';
import LoginContainer from './components/LoginContainer';
import {BrowserRouter, Routes, Route} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path=''>

      </Route>
    </Routes>
      <LoginContainer />
      <Login />

    </BrowserRouter>
  );
}

export default App;
